import React from "react"
import NavigationButton from "./NavigationButton"

class Navigation extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      page: 0
    }
    
    this.handleChange = this.handleChange.bind(this)
    this.changePageValue = this.changePageValue.bind(this)
  }

  changePageValue(value) {
    console.log(222)
    this.setState({
      page: value
    })
  }

  handleChange() {
    this.props.changePageValue(1)
    console.log(111)
  }
  test() {
    console.log(0)
  }

  render() {
    return (
    <nav className="navigation-container" onClick={this.handleChange} >
      <NavigationButton key={0} page={0}  />
      <NavigationButton key={1} page={1} onClick={this.handleChange} />
      <NavigationButton key={2} page={2} onClick={this.handleChange} />
      <NavigationButton key={3} page={3} onClick={this.handleChange} />
    </nav>
    )
  }
}

export default Navigation
